import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { ClasseService } from 'src/app/classe.service';
import { UserServiceService } from 'src/app/user-service.service';

@Component({
  selector: 'app-emp-admission',
  templateUrl: './emp-admission.component.html',
  styleUrls: ['./emp-admission.component.css']
})
export class EmpAdmissionComponent implements OnInit{
  salaire:String=""
  name: String = '';
  register:String ='';
  genre :String ='';
  photo:String ='';
  dateN: Date= new Date();
  adresse:String ='';
  role:String ='';
  father:String ='';
  profession:String ='';//experience
  nationalid:String ='';
  education:String ='';
  mobile:String ='';
  email:String ='';
  constructor(private userService:UserServiceService,private router:Router,private Cla:ClasseService){} 
  ngOnInit(): void {

  }

  ajetudient(){


    this.userService.ajStudent(this.name,this.register,this.genre,this.photo,this.dateN,this.adresse,this.role,this.father,this.profession,this.nationalid,this.education,this.mobile,this.email,this.s).subscribe(
      (response) => {
        const studentId = response.body.userId // Access the generated student ID from the response
        console.log('Student ID:', studentId);
        // Now you have the generated student ID


      },
      (error) => {
        console.error('Error:', error);
        // Handle error
      }
    );
      this.router.navigate(['/employee']);
    }
}
